import React from 'react';
import image1 from './pictures/1.png';

function AboutUs() {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-4">About Us</h1>
      <div className="grid grid-cols-2 gap-4">
        <div className="flex flex-col items-center justify-center">
          <img src={image1} alt="Image 1" className="w-full h-64 object-cover rounded-lg" />
          <p className="text-lg mt-4">Rffy Paul Carbo</p>
        </div>
        <div className="flex flex-col items-center justify-center">
          <img src="1.png" alt="Image 2" className="w-full h-64 object-cover rounded-lg" />
          <p className="text-lg mt-4">Raffy Paul Carbo</p>
        </div>
      </div>
    </div>
  );
}




export default AboutUs;
